import { StatusBar } from 'expo-status-bar';
import { SafeAreaView, StyleSheet,style, Text, View } from 'react-native';


export default function Deshboard(props) {
  return (
    <SafeAreaView>
    <View style={styles.container}>
      <Text> Tela do Deshboard </Text>
    
    </View>
    </SafeAreaView>
  );
}

const styles = StyleSheet.create({
    container: {
      flex: 1,
      backgroundColor: '#fff',
      alignItems: 'center',
      justifyContent: 'center',
    },
  });
